sys_variable_value.value:
(function execute(inputs, outputs) {
  var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gcompute_spoke.list_machine_types', {
        "project_id": inputs.projectid,
        "zone":inputs.zone
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var machines = [];
    obj.forEach(function(machineObj) {
        machines.push({
            "label": machineObj.name.toUpperCase(),
            "name": machineObj.name
        });
    })
    outputs.machines = {
        data: machines
    }
})(inputs, outputs);

